import React from 'react';
import Ccomponent from './Ccomponent';
import { Menu } from './Menu';
import './App.css';


const App = () => {
  return (
   <div className = "App">
      <ul>
        <li>
          1
        </li>
      </ul>
        <Ccomponent />
        <Menu/>
   </div>
  );
}

const Header = () => {
  return (
   <div>
     <a>Home</a>
     <a>New Feed</a>
     <a>Messages</a>
   </div>
  );
}

export default App;
